import React, { Component } from "react";

class Process extends Component {
  state = {
    processName: "Proceso numero 1"
  };

  stylesProcess = {
    fontSize: 20,
    fontWeight: "bold"
  };
  stylesButtons = {
    fontSize: 15
  };

  render() {
    return (
      <div>
        <span>
          <span style={this.stylesProcess} className="badge badge-primary m-2">
            {this.state.processName}
          </span>
          <button style={this.stylesButtons} className="btn btn-primary btn-sm">
            View
          </button>
          <button
            style={this.stylesButtons}
            className="btn btn-secondary btn-sm"
          >
            Edit
          </button>
          <button
            style={this.stylesButtons}
            className="btn btn-danger btn-sm m-1"
          >
            Delete
          </button>
        </span>
      </div>
    );
  }
}

export default Process;
